import React from "react";

export default class JugadoresPagina extends React.Component {

    constructor(props) {
        super(props);
        this.state = {
            Jugadores: []
        }

    }

      //FETCH DATA FROM API thesportsdb.com player id=34162040 https://www.thesportsdb.com/api/v1/json/2/lookupplayer.php?id=34162040

              componentDidMount() {
        const url = "https://www.thesportsdb.com/api/v1/json/2/lookupplayer.php?id=34162040";
        fetch(url)
            .then(response => response.json())
            .then(data => {
                this.setState({
                    Jugadores: data.player
                });
            });
    }


    render() {
        return (
            <div className="container">
                <div className="row">
                    <div className="col">
                        <section class="header-liga">
                            <div class="container justify-content-center align-items-center">
                                <div class="row justify-content-between">
                                    <div class="col-lg-3 d-flex flex-row justify-content-center align-items-center">
                                        <div class="header-left">
                                            <p class="text"> Jugadores </p>
                                        </div>
                                    </div>
                                    <div class="col-lg-3 mx-5">
                                        <div class="header">
                                            <p class="text"> Messi </p>
                                        </div>
                                    </div>
                                </div>
                            </div>
                        </section>
                        <table className="table table-striped">
                            <thead>
                                <tr>
                                    <th scope="col">Nombre</th>
                                    <th scope="col">Apodo</th>
                                    <th scope="col">Fecha de nacimiento</th>
                                </tr>
                            </thead>
                            <tbody>
                                {this.state.Jugadores.map((Jugador) => (
                                    <tr>
                                        <td>{Jugador.strPlayer}</td>
                                        <td>{Jugador.strNickname}</td>
                                        <td>{Jugador.dateBorn}</td>
                                    </tr>
                                ))}
                            </tbody>
                        </table>
                    </div>
                </div>
            </div>
        )
    }
}
